import React, {Component} from 'react';
import { Link, Redirect } from 'react-router-dom';
import { Row, Col } from 'react-bootstrap';
import {admin} from '../firebase.js';
import Events from '../Eventdata.json';

// Initialize firestore
let db = admin.firestore();
// Disable deprecated features
db.settings({
  timestampsInSnapshots: true
});

class EventsList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      redirect: false,
      userEmail: ''
    };
  }

  componentDidMount() {
    admin.auth().onAuthStateChanged((user) => {
      if(user === null) {
        this.setState({redirect: true});
      }
    });
  }

  render() {
    if(this.state.redirect === true) {
      return <Redirect to='/login' />
    }
    let eventLayout = Events.events;

    return (
      <div className="home-page">
        <h1 className="page-header">Live Events</h1>
        {eventLayout.map(function(user, i) {
          return <Col key={eventLayout[i].A} className="home-col-ev" xs={2}>{eventLayout[i].value}</Col>
        })}
      </div>
    )
  }
}

export default EventsList;
